			shellScript = "set -eo pipefail\n# Set to the web package you want to bundle.\n# This must point to the distribution folder (e.g, 'www' or 'build')\nAPP_NAME=\"ionic-angular/www\"\n# APP_NAME = \"ionic-react/build\"\n# APP_NAME = \"ionic-vue/dist\"\n\n# Embedded directory path\nEMBEDDED_DIR=\"${BUILT_PRODUCTS_DIR}/${TARGET_NAME}.app/portals\"\n\n# Portal name. This is the value to supply to the \"name\" input parameter.\nPORTAL_NAME=\"playground\"\n\n# Start embedding process\nEMBEDDED_APP=\"${SRCROOT}/../../web/${APP_NAME}\"\n\nmkdir -p \"${EMBEDDED_DIR}\"\necho \"I MADE ${EMBEDDED_DIR}\"\necho \"${PORTAL_NAME} ${EMBEDDED_APP}\"\n\nif [ -d \"${EMBEDDED_DIR}/${PORTAL_NAME}\" ]\nthen \n  cd \"${EMBEDDED_DIR}\"\n  rm -r \"${PORTAL_NAME}\"\nfi\n\nmkdir \"${EMBEDDED_DIR}/${PORTAL_NAME}\"\n\nZIP_FILE=\"${PORTAL_NAME}.zip\"\n\nif [ -d \"${EMBEDDED_APP}\" ] \nthen\n  cd \"${EMBEDDED_APP}\"\n  zip -vr \"${ZIP_FILE}\" * -x \"*.DS_Store\"\n  unzip \"${ZIP_FILE}\" -d \"${EMBEDDED_DIR}/${PORTAL_NAME}\"\n  rm \"${ZIP_FILE}\"\nelse\n  echo \"App ${PORTAL_NAME} has not been built! ${EMBEDDED_APP}\"\n  exit 999\nfi\n# End embedding process\n";
